static const unichar_t* GetDecomp(unichar_t ch) {
    int index = 0;
    if (ch < 0x110000) {
        index = decomp_index1[ch >> DECOMP_SHIFT];
        index = decomp_index2[(index << DECOMP_SHIFT) + (ch & ((1 << DECOMP_SHIFT) - 1))];
    }
    assert(index >= 0 && index < sizeof(decomp_data)/sizeof(decomp_data[0]));
    return &decomp_data[index];
}

int ff_unicode_hasdecomposition(unichar_t ch) {
   return *GetDecomp(ch) != 0;
}

const unichar_t* ff_unicode_decomposition(unichar_t ch) {
    const unichar_t* ptr = GetDecomp(ch);
    if (!*ptr) {
        return NULL;
    }
    return ptr;
}

